export interface SearchType {
  data: {
    empty: string;
    filled: string;
    searchData: [];
  };
}

// data[]
export interface Indexable extends SearchType {
  [key: string]: string | [];
}

export const SearchReData = ({ data: { empty, filled, searchData } }: SearchType) => {
  const searchRec = searchData ? filled : empty;
  return searchRec;
};
